import React from 'react';


const Footer = () => {
    return (
      <footer className="bg-gray-600 text-white text-center h-40 py-40 mt-10">     
            <p>&copy; {new Date().getFullYear()} STOPify. All rights reserved.</p>
      </footer>
    );
  };
  
  export default Footer;
